import React, { Component } from 'react';
import Iframe from 'react-iframe';

import iconDownload from './img/google-play-badge.png';

import './styles.scss';

class ComoJogar extends Component {
    render() {
        return (
            <section className="containerComoJogar">
                <div className="contentComoJogar">
                    <div className="headerComoJogar">
                        <h1>Como Jogar</h1>
                        <p>Novo por aqui? Veja como é fácil duelar no nosso app no vídeo abaixo. Você se diverte desafiando seus amigos enquanto aposta Stars Blue e Gold!</p>
                        <img className="image" src={iconDownload} alt="Icon Download Google Play" />
                    </div>
                    <div className="containerVideo">
                        <Iframe
                            className="iFrame"
                            title="Video Como Jogar"
                            src="https://www.youtube.com/embed/SXMzfVInOaA"
                            frameBorder="0"
                            allow="accelerometer; autoplay; encrypted-media; gyroscope; picture-in-picture"
                            allowFullScreen

                        />
                    </div>

                </div>
            </section>
        )
    }
}

export default ComoJogar;
